import React from "react";
import "../CSS/File.css";
import { Link } from "react-router-dom";

function File() {
    return <div className="File">
        <div className="welcome">
            <Link to="/accueil" className="link"><p>Accueil</p></Link>
        </div>
        <div className="textBox">

        </div>
    </div>;
}
export default File;
